objetoCompra:
Contratação de serviços continuados de estacionamento, destinados a atender às necessidades da Regional de Uberlândia/MG, compreendendo:
01 (uma) vaga de garagem de uso contínuo, disponível 24 (vinte e quatro) horas por dia, inclusive aos finais de semana;
03 (três) vagas horistas, de uso avulso, contabilizadas por hora, com estimativa média de 30 (trinta) horas semanais, admitida a variação conforme a demanda.

informacaoComplementar:
a) Instalação de tubulação em alumínio (em Y) para conexão da tubulação fixa no teto;

b) Instalação de dois suportes nos pontos de exustão (dois pontos) para fixar as coifas;

c) Revisão do exaustor existente.
